import React from 'react'
import { Link } from 'react-router-dom';
import video from '../../../src/videos/video.mp4';
import styles from './Landing.module.css'

const LandingPage = () => {
    
    return (
        <div  className= {styles.body}>
           <video className= {styles.video}autoPlay muted loop id="video">
            <source src={video} type="video/mp4" />
            </video> 
            <div>
                <div className="landingWrapper">
                    <h2 className="landingTitle">Dogs Lovers</h2>
                    <p>Let's Go!</p>
                    <div className="landingLinks">
                        <Link className="landingButton" to="/home">
                            <button>Home</button>
                        </Link>
                        <Link className="landingAbout" to="/about">
                            <button>About us</button>
                        </Link>
                    </div>
                </div>
            </div>
            
        </div>
    );

};

export default LandingPage;
